import {Grid, Table, Form, Input, Button} from 'semantic-ui-react'

const tableValuesGroupsSkills = (tableBody) => {
    
    return(
        <Table basic='very'>
            <thead>
                <tr>
                    <th>Group skills</th>
                    <th>Estimate</th>
                    <th>Fragment</th>
                    <th>Color</th>
                </tr>
            </thead>
            <tbody>
                {tableBody}
            </tbody>
        </Table>
    )
}

export default tableValuesGroupsSkills;
